          extract:
            'Monika Christodoulou also known by her stage name Monika, is a Greek singer-songwriter. Her debut album Avatar was released in 2008 and her second album Exit followed in 2010. Both albums achieved platinum status in her native Greece and were met with critical acclaim. Her third album, Secret in the Dark, was the first to be given an international release, in 2015. It was recorded in New York in collaboration with musicians from the Dap-Kings, and sees Christodoulou moving away from the folk, singer-songwriter style of her earlier albums towards a disco and funk sound.',
          extract_html:
            '<p><b>Monika Christodoulou</b> also known by her stage name <b>Monika</b>, is a Greek singer-songwriter. Her debut album <i>Avatar</i> was released in 2008 and her second album <i>Exit</i> followed in 2010. Both albums achieved platinum status in her native Greece and were met with critical acclaim. Her third album, <i>Secret in the Dark</i>, was the first to be given an international release, in 2015. It was recorded in New York in collaboration with musicians from the Dap-Kings, and sees Christodoulou moving away from the folk, singer-songwriter style of her earlier albums towards a disco and funk sound.</p>',
