          extract:
            'Natalya Yevgenyevna Gorbanevskaya was a Russian poet, a translator of Polish literature and a civil-rights activist. She was one of the founders and the first editor of A Chronicle of Current Events (1968–1982). On 25 August 1968, with seven others, she took part in the 1968 Red Square demonstration against the Soviet invasion of Czechoslovakia. In 1970 a Soviet court sentenced Gorbanevskaya to incarceration in a psychiatric hospital. She was released from the Kazan Special Psychiatric Hospital in 1972, and emigrated from the USSR in 1975, settling in France. In 2005, she became a citizen of Poland.',
          extract_html:
            '<p><b>Natalya Yevgenyevna Gorbanevskaya</b> was a Russian poet, a translator of Polish literature and a civil-rights activist. She was one of the founders and the first editor of <i>A Chronicle of Current Events</i> (1968–1982). On 25 August 1968, with seven others, she took part in the 1968 Red Square demonstration against the Soviet invasion of Czechoslovakia. In 1970 a Soviet court sentenced Gorbanevskaya to incarceration in a psychiatric hospital. She was released from the Kazan Special Psychiatric Hospital in 1972, and emigrated from the USSR in 1975, settling in France. In 2005, she became a citizen of Poland.</p>',
