          extract:
            "Iran, officially the Islamic Republic of Iran (IRI), also known by its Western-given name Persia, is a country in West Asia. It is bordered by Turkey to the northwest and Iraq to the west, Azerbaijan, Armenia, the Caspian Sea and Turkmenistan to the north, Afghanistan to the east, Pakistan to the southeast, the Gulf of Oman and the Persian Gulf to the south. With a mostly Persian-ethnic population of almost 90 million in an area of 1,648,195 km2, Iran ranks 17th globally in both geographic size and population. It is the sixth-largest country entirely in Asia, the second-largest in West Asia, and one of the world's most mountainous countries. Officially an Islamic republic, Iran has a Muslim-majority population. The country is divided into five regions with 31 provinces. The nation's capital and most populous city is Tehran, with around 16.8 million people in its metropolitan area. Other major cities include Mashhad, Isfahan, Karaj, and Shiraz.",
